import React from 'react';

function Login() {
  return (
    <div id="login-container">
      <object type="image/svg+xml" data="logo2.svg">현재 브라우저는 iframe을 지원하지 않습니다.</object>
      <div id="login-box">
      </div>
    </div>
  );
}

export default Login;
